import React, { useState, useEffect } from "react"
import Layout from "../components/layout-small"
import { StaticImage } from "gatsby-plugin-image"

const Beatus = () => {
  const [title, setTitle] = useState(0)
  const [content, setContent] = useState(1)
  useEffect(() => {
    setTitle(
      <div className="loadrr"><div><div></div><div></div><div></div><div></div></div></div>
    )
    setContent(
      '<div class="loadrr"><div><div></div><div></div><div></div><div></div></div></div>'
    )
    fetch(`${process.env.GATSBY_DIRECTUS_ENDPOINT}/items/bullenetwork_pages/9`)
      .then(response => response.json())
      .then(resultData => {
        setTitle(resultData.data.title)
        setContent(resultData.data.content)
      })
  }, [])
  return (
    <Layout layoutClass="secondary-layout beer-page-2" title="Beatus Bulla - First" >
      <section className="main-section beer">
        <div className="section-container">
          <div className="big-anchor">
            <Anchor />
          </div>
          <p className="banner-holder">
            <StaticImage src="../images/beer/esperance/infusion-banner.png" alt="esperance" className="banner"
              width={180} height={250} />
          </p>
          <h1>{title}</h1>
          <div dangerouslySetInnerHTML={{ __html: content }} />
          <p className="footer-holder">
            Brassée par la brasserie le Pélerin à Baulmes <br />
            <StaticImage src="../images/beer/esperance/mont-pelerin.png" alt="esperance" className="footer" placeholder="blurred"
              width={120}
              height={60} />
          </p>
        </div>
      </section>
    </Layout>
  )
}

export default Beatus

